Access 360 World Heritage: Angkor Wat
The magnificent temples of Angkor were mysteriously abandoned for hundreds of years. Now, the largest religious monument on earth is at risk of being lost again. It will take a team effort to restore this legendary world heritage site to its former glory. Researchers are discovering new clues about what went wrong in the past, while locals are fighting to save their heritage for the future.
National Geographic Channel has signed a ground-breaking sponsorship with Panasonic to bring a special programming block focused on UNESCO World Heritage sites to NGC viewers across five continents - Asia, North America, South America, Europe and Australia.

